contracts/Token.sol.content:
//SPDX-License-Identifier: Unlicense
pragma solidity ^0.8.9;

import "@openzeppelin/contracts/token/ERC20/ERC20.sol";
import "@openzeppelin/contracts/metatx/ERC2771Context.sol";

contract Token is ERC20, ERC2771Context {
    constructor(
        string memory name,
        string memory symbol,
        address[] memory initialOwners,
        uint256 initialOwnersLength,
        address forwarder
    ) ERC20(name, symbol) ERC2771Context(forwarder) {
        for (uint256 i = 0; i < initialOwnersLength; i++) {
            _mint(initialOwners[i], 50000 * 10**18);
        }
    }

    function _msgSender()
        internal
        view
        override(Context, ERC2771Context)
        returns (address sender)
    {
        return ERC2771Context._msgSender();
    }

    function _msgData()
        internal
        view
        override(Context, ERC2771Context)
        returns (bytes calldata)
    {
        return ERC2771Context._msgData();
    }
}

